/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trigger_validar_fecha` BEFORE INSERT ON `gastos` FOR EACH ROW BEGIN
  DECLARE ultima_fecha DATE;
  SELECT fecha INTO ultima_fecha FROM Gastos ORDER BY fecha DESC LIMIT 1;
  IF NEW.fecha < ultima_fecha THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Error: La fecha del gasto es anterior a la fecha del ltimo gasto registrado';
  END IF;
END */;;
