CREATE DEFINER=`root`@`localhost` FUNCTION `aos_clientes`(p_id_Cliente INT) RETURNS int
    DETERMINISTIC
BEGIN
  DECLARE birthday DATE;
  DECLARE years	INT;
	
    SELECT F_denacimiento
    INTO birthday
    FROM Clientes
    WHERE id_Cliente=p_id_Cliente;
    
    SET years = YEAR(curdate())- YEAR (birthday);
    IF MONTH(curdate())  <=MONTH(birthday) THEN 
     IF DAY(curdate())  <DAY(birthday) THEN 
     SET years =years-1;
     END IF;
    END IF;
RETURN years;
END ;;
